import React from 'react';
import { Button, TextField, Switch, FormControlLabel } from '@material-ui/core';

function FormularioCadastro() {

    let nome = "";
    return (
        <form 
            onSubmit={(event) => {
                preventDefault();
                console.log(nome); }}
            >
                    
            <TextField
                id="nome"
                onChange={(event) => {
                    nome = event.target.value;
                    console.log(nome);
                }}
                label="Nome"
                variant="outlined"
                margin="normal"
                fullWidth
            />

            <TextField
                id="sobrenome"
                label="Sobrenome"
                variant="outlined"
                margin="normal"
                fullWidth
            />

            <TextField
                id="cpf"
                label="CPF"
                variant="outlined"
                margin="normal"
                fullWidth
            />

            <FormControlLabel
                label="Promoções"
                control={
                    <Switch
                        name="promoções"
                        defaultChecked
                        color="primary"
                    />
                }
            />

            <FormControlLabel
                label="Novidades"
                control={
                    <Switch
                        name="novidades"
                        defaultChecked
                        color="primary"
                    />
                }
            />

            <Button
                variant="contained"
                color="primary"
                type="submit">
                Cadastrar
            </Button>
        </form>
    )
}

export default FormularioCadastro;
